            {
                DeaconCCGManagement.Test_Data.Member newMember = new DeaconCCGManagement.Test_Data.Member();

                string[] itemSplit = item.Split(',');

                newMember.IndividualId = itemSplit[0];
                newMember.LastName = itemSplit[1];
                newMember.FirstName = itemSplit[2];
                newMember.Title = itemSplit[3];
                newMember.Suffix = itemSplit[4];
                newMember.Address = itemSplit[5];
                newMember.City = itemSplit[6];
                newMember.State = itemSplit[7];
                newMember.ZipCode = itemSplit[8];
                newMember.HomePhone = itemSplit[9];
                newMember.CellPhone = itemSplit[10];
                newMember.PreferredEmail = itemSplit[11];
                newMember.FamilyNumber = itemSplit[12];
                newMember.EnvelopeNumber = itemSplit[13];
                newMember.DateOfBirth = GetDateTimeFromString(itemSplit[14]);
                newMember.DateJoined = GetDateTimeFromString(itemSplit[15]);
                newMember.EntryDate = GetDateTimeFromString(itemSplit[16]); 
                newMember.DateLastChanged = GetDateTimeFromString(itemSplit[17]);
                newMember.FamDistrictDeacon = itemSplit[18];
                newMember.CCG = itemSplit[19];

                _allMembers.Add(newMember);
            }
            return _allMembers;
        }

        private DateTime? GetDateTimeFromString(string datetimeStr)
        {
            DateTime datetime;
            if (DateTime.TryParse(datetimeStr, out datetime))
                return datetime;
            return null;
        }

        private string GetFilePath(string fileName)
        {
            // Returns the file path on web server. 

            //
            // this line blows up when update-database migration call
            //string root = HttpContext.Current.Server.MapPath(_folderName);

            string baseDir = AppDomain.CurrentDomain.BaseDirectory;

            //truncates '/bin' from the path or '/bin/Debug' if debug mode
            // use 4 if not in debug mode; 10 if debug
            int numChars = 10;
            baseDir = baseDir.Substring(0, baseDir.Length - numChars);

            //
            //DEBUG
            //
            //string test = System.IO.Path.Combine(baseDir, _folderName, fileName);
            //throw new Exception(test);

            return System.IO.Path.Combine(baseDir, _folderName, fileName);


            //string relFilePath = $"~/Test_Data/{fileName}";
            //return HostingEnvironment.MapPath(relFilePath);
           

        }
